操作后，您可以通过选择索引值来查看数据的不同部分。","upload":"使用pandas.read_csv()，pandas.read_json()或自定义的加载器将网络上或示例数据集中的CSV/TSV文件，CSV/TSV/JSON加载到D-Tale。","duplicates":"从数据中删除重复的列/值，并将重复的数据提取到单独的实例中。","theme":"在浅色和深色主题之间切换，以获取愉悦的观看效果（仅影响网格，不影响弹出窗口或图表）。","pps":"PPS是一个非对称的，与数据类型无关的评分，可以检测两列之间的线性或非线性关系。分数范围从0（无预测能力）到1（完美的预测能力）。它可以用作相关性（矩阵）的替代方法。警告：这可能需要一段时间才能加载。","low_variance_1":"在满足以下两个条件的情况下，在列标题上显示标志：。","low_variance_2":"唯一值/唯一列数量<10％。","low_variance_3":"最常用值计数/次常用值计数>20。","low_variance_4":"您可以通过单击列菜单中的“差异”选项来查看差异信息。","xarray_dim_des":"查看各个xarray尺寸。您当前正在查看：","network":"If you\'re currently viewing data containing information for a directed graph then try feeding it into our \\"Network Viewer\\"","reload_data":"Force a reload of the data from the server for the current rows being viewing in the grid by clicking this button. This can be helpful when viewing the grid from within another application like jupyter or nested within another website.","merge":"Merge & Stack (concatenate vertically) dataframes currently loaded into D-Tale or upload additional ones for that purpose.","pin_menu":"Toggle for pinning this menu to the left side of the screen.","language":"Choose which language to use when displaying the majority of text in D-Tale. Choose between english (EN) or chinese (CN). The default is english.","clear_data":"Remove this data from memory. If this is the only data loaded into memory then you will be redirected to the \\"Load Data\\" screen.","open_process":"There are multiple pieces of data loaded into memory, switch the UI to this data.","missingno":"Analyze the presence of missing data (NaN) using the \\"missingno\\" package.","predefined_filters":"Apply any \\"Predefined Filters\\" to your data. You would have loaded these using the \\"dtale.predefined_filters.set_filters\\" or \\"dtale.predefined_filters.add_filters\\" functions.","max_width":"Rebuild the widths of the cells in the grid and set a maximum width in pixels. Any column that exceeds this width will be truncated to this
